import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Routes , Link} from "react-router-dom";
import RecentResults from "./components/results/RecentResults";
import SelectPanelPage from "./components/SelectPanelPage";
import "./index.css";
class App extends Component<any, { infoOptions: any, selectedOption: any}> {
    render() {
        return (
            <div className={"flex flex-col justify-center items-center h-full w-full bg-amber-100"}>
                <Router>
                    <ul className="App-header">
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/selectpanel">About Us</Link>
                        </li>
                    </ul>
                    <div className={"text-5xl text-red-950 m-4 p-8"}>F1 Tracker</div>
                    <Routes>
                        <Route path="/selectpanel" element={<SelectPanelPage />}></Route>
                        <Route path="/" element={<RecentResults />}></Route>
                    </Routes>
                </Router>
            </div>
        );
    }
}

export default App;
